import React from 'react';
import './App.css';

function App() {
  return (
     <div>

       <div class="navbar">
         <a class="navbar-brand">Title</a>
         <ul class="nav navbar-nav">
           <li class="active">
             <a>Home</a>
           </li>
           <li>
             <a>Link</a>
           </li>
         </ul>
       </div>

     </div>
  );
}

export default App;
